Δεδομένου ότι Και έπειτα, αφού συμπληρώσεις όλα τα στοιχεία, μπορείς να συνεχίσεις από εκεί. Επομένως, πρέπει να ισχύει ότι "Μπορείτε να συνεχίσετε αφού καταχωρίσετε τις πληροφορίες στη βάση δεδομένων. "; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Η παρουσία της τη δεδομένη στιγμή, και λαμβάνοντας υπόψη τη φύση της διαμάχης του με τον Wolverstone, ήταν ντροπιαστική. Επομένως, πρέπει να ισχύει ότι "Το γεγονός ότι ήταν εδώ μετά τη μάχη με το Wolverstone θεωρήθηκε ντροπή."; Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι Αλλά ήταν, ξέρεις, με πολλούς τρόπους, σαν τον γιο του ιδιοκτήτη της φυτείας επειδή ήταν γιος αυτού του άντρα και διέθετε μεγάλη περιουσία. Επομένως, πρέπει να ισχύει ότι "Ο πατέρας του δεν είχε ποτέ τίποτα στην κατοχή του στη ζωή του."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Επομένως, πρέπει να ισχύει ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
